import{_ as e}from"./chunks/arabica-devnet.19e59c2c.js";import{_ as a,o as t,c as o,Q as r}from"./chunks/framework.51d6c45b.js";const m=JSON.parse('{"title":"Arabica-9 devnet","description":"A guide to Arabica-9 devnet.","frontmatter":{"description":"A guide to Arabica-9 devnet.","head":[["meta",{"name":"og:title","content":"Arabica-9 devnet | Celestia Docs"},{"name":"og:description","content":false}]]},"headers":[],"relativePath":"nodes/arabica-9.md","filePath":"nodes/arabica-9.md","lastUpdated":1699288246000}'),i={name:"nodes/arabica-9.md"},n=r('<h1 id="arabica-9-devnet" tabindex="-1">Arabica-9 devnet <a class="header-anchor" href="#arabica-9-devnet" aria-label="Permalink to &quot;Arabica-9 devnet&quot;">​</a></h1><p><img src="'+e+'" alt="arabica-devnet"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This page is maintained for developers still using the <code>arabica-9</code> devnet.</p><p>Refer to the <a href="./arabica-devnet">Arabica devnet</a> page for the latest updates on the Arabica devnet.</p></div><h2 id="software-version-numbers" tabindex="-1">Software version numbers <a class="header-anchor" href="#software-version-numbers" aria-label="Permalink to &quot;Software version numbers&quot;">​</a></h2><ul><li>Celestia Chain ID - <a href="https://github.com/celestiaorg/networks/tree/master/arabica-9" target="_blank" rel="noreferrer">arabica-9</a></li><li>Celestia Node - <a href="https://github.com/celestiaorg/celestia-node/releases/tag/v0.11.0-rc9.1" target="_blank" rel="noreferrer">v0.11.0-rc9.1</a></li><li>Celestia App - <a href="https://github.com/celestiaorg/celestia-app/releases/tag/v1.0.0-rc7" target="_blank" rel="noreferrer">v1.0.0-rc7</a></li><li>Rollkit - <a href="https://github.com/rollkit/rollkit/releases/tag/v0.10.2" target="_blank" rel="noreferrer">v0.10.2</a></li></ul><h2 id="integrations" tabindex="-1">Integrations <a class="header-anchor" href="#integrations" aria-label="Permalink to &quot;Integrations&quot;">​</a></h2><p>This guide contains the relevant sections for how to connect to arabica-9, depending on the type of node you are running.</p><p>Your best approach to participating is to first determine which node you would like to run. Each node&#39;s guide will link to the relevant networks in order to show you how to connect to them.</p><p>You have a list of options on the type of nodes you can run in order to participate in arabica-9:</p><p>Data Availability:</p><ul><li><a href="./bridge-node">Bridge node</a></li><li><a href="./full-storage-node">Full storage node</a></li><li><a href="./light-node">Light node</a></li></ul><p>Select the type of node you would like to run and follow the instructions on each respective page. Whenever you are asked to select the type of network you want to connect to in those guides, select <code>Arabica</code> in order to refer to the correct instructions on this page on how to connect to arabica-9.</p><h2 id="rpc-endpoints" tabindex="-1">RPC endpoints <a class="header-anchor" href="#rpc-endpoints" aria-label="Permalink to &quot;RPC endpoints&quot;">​</a></h2><p>The RPC endpoint is to allow users to interact with Celestia&#39;s nodes by querying the node&#39;s state and broadcasting transactions on the Celestia network. The default port is 26657.</p><p>Below is a list of RPC endpoints you can use to connect to arabica-9 Devnet:</p><h3 id="bridge-full-and-light-nodes" tabindex="-1">Bridge, full, and light nodes <a class="header-anchor" href="#bridge-full-and-light-nodes" aria-label="Permalink to &quot;Bridge, full, and light nodes&quot;">​</a></h3><ul><li><code>consensus-validator-arabica-9.celestia-arabica.com</code></li><li><code>validator.consensus-arabica-9.celestia-arabica.com</code></li><li><code>consensus-full-arabica-9.celestia-arabica.com</code></li></ul><h3 id="full-and-light-nodes-only" tabindex="-1">Full and light nodes ONLY <a class="header-anchor" href="#full-and-light-nodes-only" aria-label="Permalink to &quot;Full and light nodes ONLY&quot;">​</a></h3><p>These RPC endpoints do not allow you to download full blocks from them. We advise that if you are running a bridge node, that you also run a local <a href="./consensus-node">full consensus node</a> in order to download full blocks from it.</p><ul><li><code>rpc-arabica-9.consensus.celestia-arabica.com</code></li><li><code>rpc-2-arabica-9.consensus.celestia-arabica.com</code></li></ul><h2 id="api-endpoints" tabindex="-1">API endpoints <a class="header-anchor" href="#api-endpoints" aria-label="Permalink to &quot;API endpoints&quot;">​</a></h2><p>The API endpoint is to allow users to interact with the REST API in Cosmos SDK which is implemented using gRPC-gateway, which exposes gRPC endpoints as REST endpoints. This allows for communication with the node using REST calls, which can be useful if the client does not support gRPC or HTTP2. The default port is 1317.</p><ul><li><a href="https://api-arabica-9.consensus.celestia-arabica.com/" target="_blank" rel="noreferrer">https://api-arabica-9.consensus.celestia-arabica.com/</a></li><li><a href="https://api-2-arabica-9.consensus.celestia-arabica.com/" target="_blank" rel="noreferrer">https://api-2-arabica-9.consensus.celestia-arabica.com/</a></li></ul><h2 id="grpc-endpoints" tabindex="-1">gRPC endpoints <a class="header-anchor" href="#grpc-endpoints" aria-label="Permalink to &quot;gRPC endpoints&quot;">​</a></h2><p>The gRPC endpoint is to allow users to interact with a Celestia Node using gRPC, a modern open-source and high-performance RPC framework. The default port is 9090. In the Cosmos SDK, gRPC is used to define state queries and broadcast transactions.</p><ul><li><code>grpc-arabica-9.consensus.celestia-arabica.com:443</code></li><li><code>grpc-2-arabica-9.consensus.celestia-arabica.com:443</code></li><li><code>validator.consensus-arabica-9.celestia-arabica.com:9090</code></li><li><code>consensus-validator-arabica-9.celestia-arabica.com:9090</code></li></ul><h2 id="arabica-devnet-faucet" tabindex="-1">Arabica devnet faucet <a class="header-anchor" href="#arabica-devnet-faucet" aria-label="Permalink to &quot;Arabica devnet faucet&quot;">​</a></h2><div class="danger custom-block"><p class="custom-block-title">WARNING</p><p>USING THIS FAUCET DOES NOT ENTITLE YOU TO ANY AIRDROP OR OTHER DISTRIBUTION OF MAINNET CELESTIA TOKENS. THERE ARE NO PUBLIC SALES OF ANY MAINNET CELESTIA TOKENS.</p></div><h3 id="web" tabindex="-1">Web <a class="header-anchor" href="#web" aria-label="Permalink to &quot;Web&quot;">​</a></h3><p>The web faucet is available at <a href="https://faucet-arabica-9.celestia-arabica.com/" target="_blank" rel="noreferrer">https://faucet-arabica-9.celestia-arabica.com/</a>.</p><h2 id="explorers" tabindex="-1">Explorers <a class="header-anchor" href="#explorers" aria-label="Permalink to &quot;Explorers&quot;">​</a></h2><p>There is an explorer you can use for Arabica:</p><ul><li><a href="https://explorer-arabica-9.celestia-arabica.com/arabica-9" target="_blank" rel="noreferrer">https://explorer-arabica-9.celestia-arabica.com/arabica-9</a></li></ul><h2 id="network-upgrades" tabindex="-1">Network upgrades <a class="header-anchor" href="#network-upgrades" aria-label="Permalink to &quot;Network upgrades&quot;">​</a></h2><p>Join our <a href="https://t.me/+smSFIA7XXLU4MjJh" target="_blank" rel="noreferrer">Telegram announcement channel</a> for network upgrades.</p>',35),s=[n];function l(c,d,h,u,p,b){return t(),o("div",null,s)}const v=a(i,[["render",l]]);export{m as __pageData,v as default};
